import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import APIInvoke from '../../utils/APIInvoke'
import swal from 'sweetalert'


const CrearLogin = () => {

    const [usuario, setusuario] = useState({
        nombre: '',
        email: "",
        contrasena: '123',
        confirmar: '123',
       
    });
      
    const {nombre, email,contrasena, confirmar } = usuario;

 
    const onChange = (e) => {
        setusuario ({
            ...usuario,
            [e.target.name]: e.target.value
        })
            
        
    }
    
    useEffect ( () => {
        document.getElementById("nombre").focus();

    }, [])

    const crearCuenta = async () => {
         const data = {
            nombre: usuario.nombre,
            email: usuario.email,
            contrasena: usuario.contrasena,
         }          

    const response = await APIInvoke.invokePOST('/api/usuarios', data);
    console.log(response)


    }
     
    const onSubmit = (e) => {
        e.preventDefault();
        crearCuenta();

    }

    return (
        <div class='hold-transition login-page'>

            <div className="login-box">
                <div className="login-logo">
                    <Link to="#"><b>MiDulceOnline</b></Link>
                </div>
                {/* /.login-logo */}
                <div className="card">

                    <div className="card-body login-card-body">
                        <p className="login-box-msg">Iniciar Sesion</p>
                        
                        <form onSubmit={onSubmit}>

                        <div className="input-group mb-3">
                                <input type="text"
                                    className="form-control"
                                    placeholder="Nombre Completo"
                                    id="nombre"
                                    name="nombre" 
                                    value={nombre}
                                    onChange={onChange}
                                    required

                                />

                                <div className="input-group-append">
                                    <div className="input-group-text">
                                        <span className="" />
                                    </div>
                                </div>
                            </div>

                            <div className="input-group mb-3">
                                <input type="email"
                                    className="form-control"
                                    placeholder="Email"
                                    id="email"
                                    name="email"
                                    value={email}
                                    onChange={onChange}
                                    required
                                 />

                                <div className="input-group-append">
                                    <div className="input-group-text">
                                        <span className="fas fa-envelope" />
                                    </div>
                                </div>
                            </div>

                            <div className="input-group mb-3">
                                <input type="password"
                                    className="form-control"
                                    placeholder="Contraseña"
                                    id="contrasena"
                                    name="contrasena"
                                    value={contrasena}
                                    onChange={onChange}
                                    required
                                 />
                                <div className="input-group-append">
                                    <div className="input-group-text">
                                        <span className="fas fa-lock" />
                                    </div>
                                </div>
                            </div>

                            <div className="input-group mb-3">
                                <input type="password"
                                    className="form-control"
                                    placeholder="Confirmar Contraseña"
                                    id="confirmar"
                                    name="confirmar"
                                  value={confirmar}
                                  onChange={onChange}
                                    required
                                 />
                                <div className="input-group-append">
                                    <div className="input-group-text">
                                        <span className="fas fa-lock" />
                                    </div>
                                </div>
                            </div>
                            

                        
                            <div className="row">

                                <div className="col-6">
                                 <button type="submit" className="btn btn-primaryblock btn-primary">Crear Usuario </button>
                                </div>

                                <div className="col-6">
                                    <Link to="/" class="btn btn-block btn-primary">Regresar Login</Link>
                                </div>

                                {/* /.col */}
                            </div>

                        </form>



                    </div>
                </div>
            </div>
        </div >
    )

};

export default CrearLogin;
